import React from 'react'
import Api from './api';

function Print(curel){
    return (
        <>
            <h1>{curel.name}</h1>
        </>
    )
}

const Prac = () => {
  return (
    <div>
    {Api.map(Print)}
    </div>
  )
}

export default Prac;
